con:config.con:executeScript:
//Fuzzzing example:
import org.apache.commons.lang.RandomStringUtils

// check counter
if( context.fuzzCount == null )
  context.fuzzCount = 0

// randomize 5 to 15 characters
def charCount1 = (int) (Math.random() * 10) + 5
def charCount2 = (int) (Math.random() * 10) + 5

// use method in Commons Lang
parameters.password1 = RandomStringUtils.randomAlphanumeric( charCount1 )
parameters.username1 = RandomStringUtils.randomAlphanumeric( charCount2 )

return ++context.fuzzCount < 5

def searchStrings = context.expand('${Properties#searchStrings}')
def searchStringArry = searchStrings.split(",");

// check counter
if( context.searchStringLength == null )
  context.searchStringLength = 0

//set searchstring in request 
parameters.searchString = searchStringArry[context.searchStringLength].trim()

return ++context.searchStringLength < searchStringArry.length

con:mockOperation.con:dispatchPath:
def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
def holder = groovyUtils.getXmlHolder( mockRequest.requestContent )

def username = holder.getNodeValue( "//username" )
def password = holder.getNodeValue( "//password" )
def sum = username + password

// validate
if( sum.length() > 25 || sum.length() < 10 || !username.startsWith("Login") || !password.endsWith( "123" ))
 return "Invalid Login Fault"

if( context.hasProperty( sum )){
// return "Already Logged In Fault"
}

// seems ok
def sessionid = String.valueOf( Math.random() ).substring( 2 )

//Below creates key/value pair as properties
context.setProperty( sum, sessionid )//key: sum Value; value: sessionid Value
context.setProperty( sessionid, sum )//key: sessionid Value; value: sum Value

//Use requestContext.<variableName> to set value in response
//variableName must match with property name i.e. ${sessionid} and ${userName_SCRIPT} in response
requestContext.sessionid = sessionid	
requestContext.userName_SCRIPT = username
return "Ok Response"

